        `/${lang}/api/carrosserie-booking/pictures/validate`,
        data,
        false
    );
}

/**
 * Send a HTTP GET request
 * Json will already be parsed by default. If parseJson is false, it returns
 * the raw response, which is sometimes necessary when different behaviour is
 * needed based on the response status code.
 *
 * @param {string} url
 */
export async function getRequest(url, parseJson = true) {
    try {
        const response = await fetch(
            url,
            {
                method: 'GET',
                credentials: 'same-origin',
                headers: new Headers({
                    Accept: 'application/json',
                    // 'Accept-Language': lang,
                }),
            },
        );

        if (parseJson) {
            if (response.status === 200) {
                return response.json();
            }
        }

        return response;
    } catch (error) {
        console.error('Something went wrong', error);
        throw error;
    }
}


/**
 * Send a HTTP POST request
 * same as Get request
 *
 * @param {string} url
 * @param {Object|[]} body
 * @param {boolean} parseJson
 */
export async function sendPostRequest(url, body, parseJson = true) {
    try {
        const requestHeaders = {
            Accept: 'application/json',
            'Accept-Language': lang,
        };
        if (!(body instanceof FormData)) {
            requestHeaders['Content-Type'] = 'application/json';
        }
        const response = await fetch(url, {
            method: 'POST',
            credentials: 'same-origin',
            headers: new Headers(requestHeaders),
            body: body instanceof FormData ? body : JSON.stringify(body),
        });

        if (parseJson) {
            if (response.status === 200) {
                return response.json();
            } else if (response.headers.get('redirect-url')) {
                window.location = response.headers.get('redirect-url');
            } else {
                throw response;
            }
        } else if (response.headers.get('redirect-url')) {
            window.location = response.headers.get('redirect-url');
        }
        return response;
    } catch (error) {
        console.error('Something went wrong', error);
        throw error;
    }
}
